import {BrowserRouter as Router , Routes , Route, Link} from 'react-router-dom'
import './App.css';
import Data from './Data/Data';

function App() {
  return (
    <div className="App">

      <Router>
      <Link >
      <button className='loading'>Load data</button>
      </Link>
        <Routes>
          <Route path='/data' element={<Data/>}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
